<template>        <wangeditors                ref="wangeditorch"                :editorvalue="editorvalue"                :EditorImgUrl="EditorImgUrl"                :EditorVideoUrl="EditorVideoUrl"                :EditorHeight="EditorHeight"                :EditorZindex="EditorZindex"                v-on:getWangEditorValue=getWangEditorValue                v-on:getWangEditorimg=getWangEditorimg                v-on:getWangEditorvideo="getWangEditorvideo"        ></wangeditors></template><script lang="ts">    // 设置html：标签绑定属性  :Editorhtml    // 获取html：标签绑定回调函数  v-on:EditorValueFn 回调带有一个参数（输出的html）    // 示例： <wangeditor :Editorhtml="Editorhtml" v-on:EditorValueFn="EditorValueFn"></wangeditor>    // 需要注意的是：从编辑器中获取的 html 代码是不包含任何样式的纯 html，如果显示的时候需要对其中的 <table> <code> <blockquote>    // 等标签进行自定义样式（这样既可实现多皮肤功能）请引入插件中的 /css/tab.css 文件    import {ref,defineComponent } from "vue";    import wangeditors from "./components/wangeditor.vue";    export default defineComponent({        name: 'wangeditor',        components:{wangeditors},        props:{            Editorhtml:String,            EditorImgUrl:String,            EditorVideoUrl:String,            EditorHeight:Number,            EditorZindex:Number        },        setup(props: any, content: any){             const editorvalue = props.Editorhtml;             const EditorImgUrl = props.EditorImgUrl;             const EditorVideoUrl = props.EditorVideoUrl;             const EditorHeight = props.EditorHeight;             const EditorZindex = props.EditorZindex;             const getWangEditorValue = (str:string) => {                 content.emit('EditorValueFn', str);             }             const getWangEditorimg = (str:string)=>{                 content.emit('getWangEditorimg', str);             }            const getWangEditorvideo = (str:string)=>{                content.emit('getWangEditorvideo', str);            }             const wangeditorch = ref();             return {                 getWangEditorValue,                 editorvalue,                 getWangEditorimg,                 getWangEditorvideo,                 EditorImgUrl,                 EditorVideoUrl,                 EditorHeight,                 EditorZindex             }         }    })</script><style scoped></style>